import styled from "styled-components";

const Father = styled.div`
  display: flex;
`;
const BoxOne = styled.div`
  background-color: teal;
  width: 100px;
  height: 100px;
`;
// backtick ``
const BoxTwo = styled.div`
  background-color: tomato;
  width: 100px;
  height: 100px;
`;
const Text = styled.span`
  color: white;
`;
function App() {
  return (
    // 원래방법
    <Father>
      <BoxOne>
        <Text>Hello</Text>
      </BoxOne>

      <BoxTwo />
    </Father>
  );
}

export default App;
